import React from "react";
import "../../../Styles/Pages/Home/LandingSecond.scss";

function LandingSecond() {
  return (
    <div className='landingSecond'>
      <div className='landingSec__title'>
        <h2>Make Paying Simple</h2>
        <p>
          Reduce barriers to purchase your product or service with our variety
          of payment features.
        </p>
      </div>
      <div className='landingSec__row'></div>
    </div>
  );
}

export default LandingSecond;
